  false,\n\t\"url\": null,\n\t\"notes\": \"In efforts to detect the species of waterbirds
  utilizing wetlands on Waterfowl Production Areas (WPAs), staff of the Devils Lake
  Wetland Management District conducted a survey in 2004. The objectives of this survey
  were to develop an inventory of the waterbirds that utilize the WPAs within the
  District, and make basic generalizations regarding habitats used by these species.
  This data will especially be important for appropriately planning for management
  in drafting the District's Comprehensive Conservation Plan in 2006.  This report
  communicates the methods, results and discussion from this survey.\",\n\t\"owner_org\":
